        /// <summary>
        /// All API operation names for a given API domain name (as string).
        /// </summary>
        public static List<string> ApiOperationsByApiDomainName(
            string domainName
        )
        {
            if (Enum.TryParse<ApiDomainName>(domainName, out ApiDomainName domainNameEnumVal))
            {
                // The provided operation is a valid enum member.
                return ApiOperationsByApiDomainName(domainNameEnumVal);
            }
            return new List<string>();
        }

        /// <summary>
        /// Kinds of root fields: query or mutation.
        /// </summary>
        public enum RootFieldKind
        {
            Unknown,
            Query,
            Mutation,
        }

        public static string GetRootFieldKind( string GqlRootFieldName )
        {
            if (!string.IsNullOrEmpty(GqlRootFieldName))
            {
                // it's a query if the root field name
                // is a value in the GqlQueryName enum
                if (Enum.TryParse<GqlQueryName>(GqlRootFieldName, out _))
                {
                    return "query";
                }
                // it's a mutation if the root field name
                // is a value in the GqlMutationName enum
                if (Enum.TryParse<GqlMutationName>(GqlRootFieldName, out _))
                {
                    return "mutation";
                }
            }
            return "";
        }

    }
